import './Concept.css'

const Concept = (props) => {
    return (
        <div>
        <li className="concept"></li>
        <img src={props.image} alt={props.title} />
        <h2>{props.title}</h2>
        <p>{props.description}</p>
        </div>
    )
}

export default Concept
